import React from "react";
import { Link, Router } from '../../routes';
import { NavLink } from 'react-router-dom';
import { MetaMaskButton } from 'rimble-ui';

import {
    Card,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    Dropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    InputGroup,
    InputGroupAddon,
    InputGroupText,
    FormInput,
    Button,
    Collapse
  } from "shards-react";

  export default class NavBar extends React.Component {
    constructor(props) {
      super(props);
  
      this.toggleDropdown = this.toggleDropdown.bind(this);
      this.toggleNavbar = this.toggleNavbar.bind(this);
  
      this.state = {
        dropdownOpen: false,
        collapseOpen: false
      };
    }
  
    toggleDropdown() {
      this.setState({
        ...this.state,
        ...{
          dropdownOpen: !this.state.dropdownOpen
        }
      });
    }
  
    toggleNavbar() {
      this.setState({
        ...this.state,
        ...{
          collapseOpen: !this.state.collapseOpen
        }
      });
    }
    
   
    render() {
      return (   
      <div>
        <Navbar type="dark" theme="primary" expand="md">
          <NavbarBrand href="/">Crypto Asset Consortium</NavbarBrand>
          <NavbarToggler onClick={this.toggleNavbar} />
  
          <Collapse open={this.state.collapseOpen} navbar>
            <Nav navbar>
              <NavItem>
                <NavLink activeclassname="active-link-color" href="/assetpool">
                  Interest Asset Pool
                </NavLink>
              </NavItem>
              <NavItem>
                <NavLink active href="#">
                  Interest Loan Protocol
                </NavLink>
              </NavItem>
              <NavItem>
                <NavLink active href="#">
                  Loan Funding Protocol
                </NavLink>
              </NavItem>
              <NavItem>
                <NavLink active href="#">
                  Compound Interest Protocol
                </NavLink>
              </NavItem>
            </Nav>
            <Nav className="ml-auto">
              <NavItem>
                <NavLink active href="/interestpool">
                  <Button outline theme="success" size="md" className="my-2 mr-1">
                   APP
                  </Button>
                </NavLink>
              </NavItem>
            </Nav>
          </Collapse>
        </Navbar>
        <style jsx>{`
          .active-link-color {color:red;}`}
        </style>
			</div>
      
      );
    }
  }
